import React, { useState, useEffect } from "react";
import axios from "axios";
import "./report.css";

const Report = () => {
  const [company, setCompany] = useState("");
  const [department, setDepartment] = useState("");
  const [mainCategory, setMainCategory] = useState("");
  const [type, setType] = useState("");
  const [computerComponents, setComputerComponents] = useState("");
  const [companies, setCompanies] = useState([]);
  const [departments, setDepartments] = useState([]);
  const [mainCategories, setMainCategories] = useState([]);
  const [types, setTypes] = useState([]);
  const [assetRegisterDetails, setAssetRegisterDetails] = useState([]);
  const [filteredAssets, setFilteredAssets] = useState([]);

  useEffect(() => {
    fetchAssets();
  }, []);

  const fetchAssets = async () => {
    try {
      const response = await axios.get("http://localhost:8000/api/AssetRegisterDetails/getAssetDetails");
      setAssetRegisterDetails(response.data);

      // Extract unique filter values
      const uniqueCompanies = [...new Set(response.data.map(asset => asset.company))];
      const uniqueDepartments = [...new Set(response.data.map(asset => asset.department))];
      const uniqueCategories = [...new Set(response.data.map(asset => asset.mainCategory))];
      const uniqueTypes = [...new Set(response.data.map(asset => asset.type))];

      setCompanies(uniqueCompanies);
      setDepartments(uniqueDepartments);
      setMainCategories(uniqueCategories);
      setTypes(uniqueTypes);
    } catch (error) {
      console.error("Error fetching asset details:", error);
    }
  };

  useEffect(() => {
    filterAssets();
  }, [company, department, mainCategory, type]);

  const filterAssets = () => {
    let filtered = assetRegisterDetails;

    if (company) {
      filtered = filtered.filter(asset => asset.company === company);
    }
    if (department) {
      filtered = filtered.filter(asset => asset.department === department);
    }
    if (mainCategory) {
      filtered = filtered.filter(asset => asset.mainCategory === mainCategory);
    }
    if (type) {
      filtered = filtered.filter(asset => asset.type === type);
    }

    setFilteredAssets(filtered);
  };

  return (
    <div>
      {/* Filters Section */}
      <div className="filters">
        <select value={company} onChange={(e) => setCompany(e.target.value)}>
          <option value="">Select Company</option>
          {companies.map((com, index) => (
            <option key={index} value={com}>
              {com}
            </option>
          ))}
        </select>

        <select value={department} onChange={(e) => setDepartment(e.target.value)}>
          <option value="">Select Department</option>
          {departments.map((dep, index) => (
            <option key={index} value={dep}>
              {dep}
            </option>
          ))}
        </select>

        <select value={mainCategory} onChange={(e) => setMainCategory(e.target.value)}>
          <option value="">Select Category</option>
          {mainCategories.map((cat, index) => (
            <option key={index} value={cat}>
              {cat}
            </option>
          ))}
        </select>

        <select value={type} onChange={(e) => setType(e.target.value)}>
          <option value="">Select Type</option>
          {types.map((t, index) => (
            <option key={index} value={t}>
              {t}
            </option>
          ))}
        </select>
      </div>

      {/* Display Filtered Results */}
      {filteredAssets.length > 0 ? (
        <table className="asset-table">
          <thead>
            <tr>
              <th>Company</th>
              <th>Department</th>
              <th>Category</th>
              <th>Type</th>
              <th>Asset Name</th>
              <th>Serial Number</th>
            </tr>
          </thead>
          <tbody>
            {filteredAssets.map((asset, index) => (
              <tr key={index}>
                <td>{asset.company}</td>
                <td>{asset.department}</td>
                <td>{asset.mainCategory}</td>
                <td>{asset.type}</td>
                <td>{asset.assetName}</td>
                <td>{asset.serialNumber}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No matching assets found.</p>
      )}
    </div>
  );
};

export default Report;
